INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760136680442', 'Cabillaud tom yam', 'Dos de cabillaud sauce Tom-Yam 50% : CABILLAUD 30%, lait de coco 8,5%(extrait de coco, eau), lait de coco 8,5% (extrait de coco, eau, emulsifiant : polysorbate 60), purée de citron jaune (purée de citron jaune (purée de citron jaune, jus de citron jaune à base de concentré, pulpe de citron jaune), sucre de canne), pâte tom yam 1,0% (citronnelle, huile de SOJA, oignon, sel, piment, eau, galanga, jus de citron, sucre, ail, exhausteur de goût : glutamate monosodique, feuille de citron, arome crevette artificiel, acidifiant : acide citrique), épaississant : amidon modifié de maïs, sucre, curcuma 0,2%, sel, poivre. Ecrasé de pomme de terre 50% : pomme de terre 41%(pomme de terre, antioxydant : biSULFITE de sodium), eau, BEURRE 2,9%, flocon pomme de terre 2,0% (pomme de terre, emulsifiant : monostéarate de glycérol de colza, épice : curcuma), sel, poivre, curcuma.', 'https://static.openfoodfacts.org/images/products/376/013/668/0442/front_fr.18.400.jpg', '7.2', '5', '12', '1.3', '', '9', '0.9', '0.354330708661417', '', '1');

