INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760136680749', 'Risotto poulet', 'Risotto cuisiné : eau, riz 18%, crème 13% (dont stabilisant : carraghénanes), oignon, huile d’olive, fond de volaille aromatisé déshydraté (sel, fécule de pomme de terre, arômes naturels, graisse de poulet, plantes aromatiques, poulet, poireau, levure, épices), emmental râpé (lait, sel, ferments, présure, anti-mottant : fécule de pomme de terre), échalote, vin blanc réduit (sulfites), poivre blanc, épaississants : gomme de guar, gomme de xanthane ; Garniture : viande de poulet cuite 16% [viande de poulet (origine : France), sel], morilles 3,4%, petit pois 3,2%, piment, persil.', 'https://static.openfoodfacts.org/images/products/376/013/668/0749/front_fr.19.400.jpg', '7.6', '3.2', '18', '1.2', '', '5.4', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760136680756', 'Risotto curry vert', 'Risotto cuisiné 86% : Eau, riz à risotto 18%, CREME stérilisée U.H.T (CREME, stabilisant : carraghénanes), lait de coco 9,8% (extrait de coco, eau), petit pois, oignon, huile d\'olive, emmental râpé (LAIT, sel, chlorure de calcium, ferments LACTIQUES, enzyme coagulante, anti-mottant : fécule de pomme de terre), carotte, arôme St Jacques (arômes, sirop de glucose, sel, maltodextrine de pomme de terre, poudre de LAIT, LACTOSE, protéines de LAIT, extrait de coquille SAINT-JACQUES, CREME), sel, concentré de vin blanc (SULFITES), curcuma 0,1%, curry vert 0,1% (curcuma, coriandre, cannelle, girofle, cumin, fenugrec, cardamome verte et noire, ail, poivre noir, sel, muscade) Garniture 14% : CREVETTE 14% (eau, sel, stabilisant: triphosphate), sel, poivre.', 'https://static.openfoodfacts.org/images/products/376/013/668/0756/front_fr.21.400.jpg', '9.6', '5.2', '7', '1', '', '6.2', '1', '0.393700787401575', '', '1');

