VALUES ('3760136680770', 'Quinoa vert', 'Quinoa cuit 64% (eau, quinoa 27%, sel, curcuma) haricots verts 11%, petit pois 11%, huile d\'olive, épinard branche 3,9%, coriandre 1,2%, sel, ciboulette, persil, poivre.', 'https://static.openfoodfacts.org/images/products/376/013/668/0770/front_fr.23.400.jpg', '9.4', '1.3', '17', '1.9', '', '4.9', '0.9', '0.354330708661417', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760136681173', 'Risotto au Crabe (creamy spicy*)', 'Risotto cuisiné 84,5 % : crème 27 % (dont stabilisant : carraghénanes), eau, riz 17 %, oignon, huile d\'olive, échalote, lait de coco (extrait de coco, eau), pâte tom-yam 1,5 % (huile de _soja_, citronnelle 0,2 %, échalote, eau, jus de citron, sel, piment, galanga, sucre, feuille de bergamote, exhausteur de goût : E621, colorant : E160c, conservateur : E211), fromages râpés (_lait_, sel, présure, conservateur : E1105, issu de l\'_œuf_), fumet de poisson aromatisé (sel, _poissons_ blancs, oignon, arômes naturels, sucre, huile de tournesol, extrait de vin blanc, amidon de _blé_, jus de citron, ail), arôme type coquille saint-jacques (arômes, sirop de glucose, sel, maltodextrine de pomme de terre, poudre de lait, lactose, protéines de lait, extrait de _coquilles saint-jacques_, crème), sel, curcuma, épaississants : E412, E415, saccharose et/ou dextrose de blé et maïs ; garniture 15,5 % : chair de _crabe_ 6,2 %, filet de cabillaud, petit pois 2,9 %, carotte 1,6 %.', 'https://static.openfoodfacts.org/images/products/376/013/668/1173/front_fr.5.400.jpg', '12.1', '', '19.3', '', '', '4.7', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760136681333', 'Macaroni morilles', 'Sauce morilles 59% : CREME 30% (dont stabilisant : carraghénanes), eau, EMMENTAL râpé 5,4% (LAIT, sel, chlorure de calcium, ferments LACTIQUES, enzyme coagulante, anti-mottant : fécule de pomme de terre), morilles 4,7%, Porto rouge (porto, sel, arôme naturel de poivre, SULFITES), échalote 2,7%, fond de volaille aromatisé déshydraté (sel, arômes, farine de BLE, graisse de poulet, fécule de pomme de terre, viande de poulet, plantes aromatiques, antiagglomérant : silice colloïdale, carbonate de magnésium, poireaux, épices, antioxydant : extrait de romarin), farine de BLE, BEURRE, arôme naturel morilles (sirop de sucre, maltodextrine de maïs, propylène glycol, alcool, conservateur : benzoate de sodium, accidifiant : acide citrique), colorant : caramel ordinaire (sucre [betterave et canne à sucre], eau), sel, poivre blanc, épaississants : gomme de xanthane, gomme de guar, dextrose ; Macaroni cuits 41% : eau, macaroni 13% (semoule de BLE dur, poudre de blanc d\'ŒUF), sel, curcuma.', 'https://static.openfoodfacts.org/images/products/376/013/668/1333/front_fr.32.400.jpg', '10', '6.2', '16.4', '2.3', '', '5.6', '1', '0.393700787401575', '', '1');

