VALUES ('3760136681500', 'Linguine Chic (crevettes coriandre ail et poivre noir)', 'Linguine cuisinées 76.5 % : eau, linguine 18 % (semoule de _blé_ dur), _beurre_, ail 2.7 %, fumet de poisson aromatisé déshydraté (sel, _poissons_ blancs, oignons, arômes naturels, sucre, huile de tournesol, extrait de vin blanc, amidon de blé, jus de citron, ail), coriandre 0.9 %, amidon de maïs, champignon noir déshydraté 0.4 %, sel, poivre noir 0.2 %, curcuma ; crevettes cuites 23.5 % : _crevettes_ 23 %, persil, sel, poivre.', 'https://static.openfoodfacts.org/images/products/376/013/668/1500/front_fr.5.400.jpg', '3.5', '', '20.1', '', '', '6.6', '', '', '', '1');

